const Contact = () => {
  return (
    <>
      <style jsx global>{`
        body {
          background-image: url("/contactmatty.jpg");
          background-position: center -200px;
          background-attachment: fixed;
        }
      `}</style>
    </>
  );
};

export default Contact;
